pub enum Error {
    CargoMetadata {
        stderr: String,
    },
    Io(io::Error),
    Utf8(Utf8Error),
    ErrUtf8(FromUtf8Error),
    Json(::serde_json::Error),
}

pub enum Message {
    CompilerArtifact(Artifact),
    CompilerMessage(CompilerMessage),
    BuildScriptExecuted(BuildScript),
    Unknown,
}

pub enum CargoOpt {
    AllFeatures,
    NoDefaultFeatures,
    SomeFeatures(Vec<String>),
}
